import React from 'react';
import styled from 'styled-components';
import Container from './Container';

const Head = styled.header`
  height: 100px;
`;

const Logo = styled.div``;
const Menu = styled.div``;

function Header() {
  return (
    <Head>
      <Container>
        <Logo>
          <a href="/">
            krzysztof <br /> koziol
          </a>
        </Logo>
      </Container>
    </Head>
  );
}

export default Header;
